import { createSelector } from 'reselect';
import { getExperimentsData, getSelectedExperiment } from './projects';

export const getSelectedExperimentData = createSelector(
    [getExperimentsData],
    (experiments) => {
        const { experimentsList } = experiments;
        const tmp = experimentsList.filter(experiment => experiment.id === getSelectedExperiment);
        console.log(tmp);
    },
);

